import SearchBar from "./SearchBar"
import styles from './Nav.module.css'

function Nav({onSearch}) {
    return (

        <div className={styles.navegacion}>
            <link>
                <span >Home</span>
            </link>

            <span >About</span>
            <SearchBar onSearch={onSearch} />
        </div>
    )

}

export default Nav

